import React from 'react'
import NewCategoryForm from './NewCategoryForm'
import NewGoalForm from './NewGoalForm'
// import { useState } from 'react'
import { Link} from 'react-router-dom';
import GoalContainer from './GoalContainer';
import CategoryContainer from './CategoryContainer'


export default function DashBoard(props) {

    console.log(props.userInfo.categories)
    // console.log(goals)

    // render goals
    let renderGoals = props.userInfo.categories.map((category) => {
        return <GoalContainer categoryName={category.name} goalArr={category.goals}/>
    })


    return (
        <section className="hero is-fullheight">
            <nav className="hero-head">

                <div className="columns is-mobile is-marginless">
                    <div className="column left">
                    <p className="navbar-item"><Link to='/dashboard'>Dashboard</Link></p>
                    <p className="navbar-item">Preferences</p>
                    </div>
                    <div className="column center">
                    <p>Hello {props.userInfo.name} remember "{props.userInfo.quote}"</p>
                    </div>
                    <div className="column right">
                        <button className="button is-primary" onClick={props.logout}>Logout</button>
                    </div>
                </div>

            </nav>

        <div className="level-item">
            <NewCategoryForm userInfo={props.userInfo} addCategory={props.addCategory}/></div>
            {/* {props.userInfo.categories.map((category, index) => (<p key={index}>{category.name} Duration {category.duration}</p>))} */}
        <div className="level-item">
            <CategoryContainer categories={props.userInfo.categories}/>
        </div>
        <div className="level-item">
            <NewGoalForm userInfo={props.userInfo} addGoal={props.addGoal}/>
            {renderGoals}
        </div>


        </section>
    )
}
